import { useState } from 'react'
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom'
import StartPage from './components/StartPage';
import './App.css';



const App = () => {
  return (
    <Router>
      <div className='container'>
        <StartPage />
        <Routes>
          <Route path="/" exact component={ StartPage } />
        </Routes>
      </div>
    </Router>
  )
}





export default App;
